<p>本文主要对JVM 内存结构进行讲解，注意不要和Java内存模型混淆了。原先这里放了一篇我自己整理的文章，最近看到<strong>海星的javakeeper公众号</strong>整理的文章，整理的很好。所以替换为他的文章，以方便你构筑JVM内存结构的知识体系。</p>
